// styles.js
export const styles = {
  container: {
    maxWidth: 960,
    margin: "0 auto",
    padding: 24,
    fontFamily: "'Segoe UI', sans-serif",
    backgroundColor: "#f9f9f9",
    color: "#333",
    minHeight: "100vh",
  },
  title: {
    fontSize: 26,
    fontWeight: "bold",
    marginBottom: 20,
  },
  footer: {
    marginTop: 40,
    fontSize: 12,
    color: "#999",
    textAlign: "center",
  },
  input: {
    padding: 10,
    fontSize: 16,
    width: 300,
    marginRight: 12,
    border: "1px solid #ccc",
    borderRadius: 4,
  },
  select: {
    padding: 10,
    fontSize: 16,
    width: 320,
    border: "1px solid #ccc",
    borderRadius: 4,
  },
  table: {
    marginTop: 24,
    width: "100%",
    borderCollapse: "collapse",
    backgroundColor: "#fff",
  },
  th: {
    backgroundColor: "#ececec",
    padding: 8,
    border: "1px solid #ddd",
    textAlign: "left",
  },
  td: {
    padding: 8,
    border: "1px solid #ddd",
  },
  noResult: {
    marginTop: 24,
    fontStyle: "italic",
    color: "#777",
  },
};
